function performOperator(value1, value2, operator)  {
    switch(operator)   {
        case ">":
            return value1 > value2;
        case "<":
            return value1 < value2;
        case "=":
            return value1 == value2;
        case ">=":
            return value1 >= value2;
        case "<=":
            return value1 <= value2;
        case "!=":
            return value1 != value2;
    }
}

function processGuilt(value) {
    switch(value)   {
        case 1:
            return 1.25;
        case 2:
            return 1.50;
        case 3:
            return 2.00;
        case 4:
            return 2.30;
        case 5:
            return 2.50;
        case 6:
            return 2.80;
        case 7:
            return 3.00;
        case 8:
            return 3.30;
        case 9:
            return 3.80;
        case 10:
            return 4.20;
    }
}

