function compareDropdown(value) {
    if(value.value == "Up")   {
        var captionContainer = document.getElementById(value.parentNode.id + "caption");
        if(captionContainer)    {
            captionContainer.classList.toggle("showCaption");
        }
    }
    else if(value.value != "Up")   {
        var captionContainer = document.getElementById(value.parentNode.id + "caption");
        if(captionContainer)    {
            captionContainer.classList.remove("showCaption");
        }
    }
}

function parseMedalName(value)  {
    // Handle shorthand and synonyms
    value = value.toLowerCase();
    if(value.length > 0)    {
        if(value.length > 1)    {
            /*
            if((value.indexOf(" i") != -1 || value.substring(0, 1) == "i") && value.indexOf("ienzo") == -1 && value.indexOf("incredibles") == -1 && value.indexOf("isa") == -1 && value.indexOf("iago") == -1 && value.indexOf("ice") == -1 && value.indexOf("illustrated") == -1 && value.indexOf("kh i") == -1)    {
                value = value.replace("i", "illustrated ");
            }
            */

            if(value.substring(0, 2) == "ka" && value.indexOf("kairi") == -1 && value.indexOf("wakka") == -1 && value.indexOf("kefka") == -1)    {
                value = value.replace("ka", "key art ");
            }
            else if(value.substring(0, 2) == "sn" && value.indexOf("ka") != -1 && value.indexOf("ka") > value.length - 5)  {
                value = value.replace("ka", "key art ");
            }
        }
        value = value.replace("supernova++", " supernova ++ ");
        value = value.replace("sn++", " supernova ++ ");
        value = value.replace("sn+", " supernova + ");
        value = value.replace("sn ", " supernova ");
        value = value.replace("#", " # ");
        value = value.replace(/-/g, " - ");
        value = value.replace("(", " ( ");
        value = value.replace(")", " ) ");
        value = value.replace("[", " [ ");
        value = value.replace("]", " ] ");
        value = value.replace(/,/g, " , ");
        value = value.replace(/&/g, " & ");
        value = value.replace("kh2", "kh ii");
        value = value.replace("kh3", "kh iii");
        console.log(value);
        queryArray = value.split(" ");
    }
    else    {
        queryArray = [];
    }
}

document.getElementById("searchMedalString").onkeydown = function(event) {
    if (event.keyCode == 13) {
        searchMedal();
    }
}

function quickSort(originalArr, sortChecker) {
    if (originalArr.length <= 1) {
        return originalArr;
    }
    else if(sortChecker == "Hits") {
        var leftArr = [];              
        var rightArr = [];
        var newArr = [];
        var pivot = originalArr[0];
        var length = originalArr.length;
        for (var i = 1; i < length; i++) {
            if (medalDatabase[originalArr[i]].Ability.Hits >= medalDatabase[pivot].Ability.Hits) {
                leftArr.push(originalArr[i]);
            }  
            else {
                rightArr.push(originalArr[i]);
            }
        }
        return newArr.concat(quickSort(leftArr, sortChecker), pivot, quickSort(rightArr, sortChecker));
    }
    else if(sortChecker == "Multi") {
        var leftArr = [];              
        var rightArr = [];
        var newArr = [];

        var pivot = originalArr[0];
        
        var length = originalArr.length;
        for (var i = 1; i < length; i++) {
            if(medalDatabase[originalArr[i]].Multi != undefined && medalDatabase[pivot].Multi != undefined)    {
                if (medalDatabase[originalArr[i]].Multi >= medalDatabase[pivot].Multi) {
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].Multi != undefined && medalDatabase[pivot].HighMulti != undefined)    {
                if (medalDatabase[originalArr[i]].Multi >= medalDatabase[pivot].HighMulti) {
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].HighMulti != undefined && medalDatabase[pivot].Multi != undefined)    {
                if (medalDatabase[originalArr[i]].HighMulti >= medalDatabase[pivot].Multi) {
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].HighMulti != undefined && medalDatabase[pivot].HighMulti != undefined)    {
                if (medalDatabase[originalArr[i]].HighMulti >= medalDatabase[pivot].HighMulti) {
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
        }
        return newArr.concat(quickSort(leftArr, sortChecker), pivot, quickSort(rightArr, sortChecker));
    }
    else if(sortChecker == "MaxMulti") {
        var leftArr = [];              
        var rightArr = [];
        var newArr = [];

        var pivot = originalArr[0];
        
        var length = originalArr.length;
        for (var i = 1; i < length; i++) {
            if(medalDatabase[originalArr[i]].Multi != undefined && medalDatabase[pivot].Multi != undefined)    {
                if ((medalDatabase[originalArr[i]].Multi * processGuilt(medalDatabase[originalArr[i]].Guilt)) >= medalDatabase[pivot].Multi * processGuilt(medalDatabase[pivot].Guilt)) {    // using pivot value start comparing
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].Multi != undefined && medalDatabase[pivot].HighMulti != undefined)    {
                if ((medalDatabase[originalArr[i]].Multi * processGuilt(medalDatabase[originalArr[i]].Guilt)) >= medalDatabase[pivot].HighMulti * processGuilt(medalDatabase[pivot].Guilt)) {    // using pivot value start comparing
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].HighMulti != undefined && medalDatabase[pivot].Multi != undefined)    {
                if ((medalDatabase[originalArr[i]].HighMulti * processGuilt(medalDatabase[originalArr[i]].Guilt)) >= medalDatabase[pivot].Multi * processGuilt(medalDatabase[pivot].Guilt)) {    // using pivot value start comparing
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
            else if(medalDatabase[originalArr[i]].HighMulti != undefined && medalDatabase[pivot].HighMulti != undefined)    {
                if ((medalDatabase[originalArr[i]].HighMulti * processGuilt(medalDatabase[originalArr[i]].Guilt)) >= medalDatabase[pivot].HighMulti * processGuilt(medalDatabase[pivot].Guilt)) {    // using pivot value start comparing
                    leftArr.push(originalArr[i]);
                }  
                else {
                    rightArr.push(originalArr[i]);
                }
            }
        }
        return newArr.concat(quickSort(leftArr, sortChecker), pivot, quickSort(rightArr, sortChecker));
    }
    else {
        var leftArr = [];              
        var rightArr = [];
        var newArr = [];
        var pivot = originalArr[0];
        var length = originalArr.length;
        for (var i = 1; i < length; i++) {
            if (medalDatabase[originalArr[i]][sortChecker] >= medalDatabase[pivot][sortChecker]) {    // using pivot value start comparing
                leftArr.push(originalArr[i]);
            }  
            else {
                rightArr.push(originalArr[i]);
            }
        }
        return newArr.concat(quickSort(leftArr, sortChecker), pivot, quickSort(rightArr, sortChecker));
    }
}

