function searchMedal()  {
    var resDiv = document.getElementById("resultsList");

    resDiv.innerHTML = "";

    secondaryInfo = document.getElementById("secondaryInformation").value;

    sortCondition = document.getElementById("sortCondition").value;

    

    // console.log("Secondary: " + secondaryInfo + " / Sort: " + sortCondition);

    var workingArray = [];

    for(var p = 1; p < Object.keys(medalDatabase).length + 1; p++) {
        workingArray[p] = p;
    }

    // Check conditions
    if(maxResults == -1)    {       // Ignore if page load
        var tempCount = 0;
        for(var i = 1; i < 8; i++)  {
            if((document.getElementById("Rarity" + i).src).indexOf("Off.png") != -1) {
                tempCount++;
            }
            if(tempCount >= 7)  {
                rarityOff = "True";
            }
            else{
                rarityOff = "False";
            }
        }

        tempCount = 0;
        var tempElementArray = ["Power", "Speed", "Magic", "Upright", "Reversed"];
        for(var tempItem of tempElementArray)  {
            if((document.getElementById(tempItem).src).indexOf("Off.png") != -1) {
                tempCount++;
            }
            if(tempCount >= 5)  {
                attributeOff = "True";
            }
            else{
                attributeOff = "False";
            }
        }

        tempCount = 0;
        for(var i = 1; i < 11; i++)  {
            if((document.getElementById("Guilt" + i).src).indexOf("Off.png") != -1) {
                tempCount++;
            }
            if(tempCount >= 10)  {
                guiltOff = "True";
            }
            else{
                guiltOff = "False";
            }
        }

        for(var i = workingArray.length - 1; i > 0; i--)   {
            var entry = medalDatabase[workingArray[i]];
            if(checkConditions(workingArray[i]) == 0)  {
                workingArray.splice(i, 1);
            }
        }
    }

    workingArray.splice(0, 1);

    workingArray = quickSort(workingArray, sortCondition);

    if(document.getElementById("ascendingOrder").value == "Ascending")    {
        workingArray = workingArray.reverse();
    }

    if(maxResults == -1)    {
        resDiv.style = "color: rgb(0, 29, 119); font-size: 36px; text-shadow: 1px 1px rgb(0, 148, 211)";
        resDiv.appendChild(document.createTextNode((workingArray.length) + " results found."));
        var blankSpacer = document.createElement('br');
        resDiv.appendChild(blankSpacer);
    }
    else    {
        resDiv.style = "color: rgb(0, 29, 119); font-size: 36px; text-shadow: 1px 1px rgb(0, 148, 211)";
        resDiv.appendChild(document.createTextNode("Displaying " + maxResults + " most recent entries"));
        var blankSpacer = document.createElement('br');
        resDiv.appendChild(blankSpacer);
    }

    for(var i = 0; i < workingArray.length && i < ((maxResults == -1) ? workingArray.length : maxResults); i++)   {
        var entry = medalDatabase[workingArray[i]];

            var newFig = document.createElement('figure');

            var newFigCaption = document.createElement('figcaption');
            newFigCaption.className = "shape1";
            newFigCaption.innerHTML = entry.Rarity + "★ " + entry.Name;

            var secondaryFigCaption = document.createElement('figcaption');
            secondaryFigCaption.className = "shape2";

            if(secondaryInfo == "Multi")    {
                if(entry.Multi != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.Multi).toFixed(2);
                }
                if(entry.HighMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.LowMulti).toFixed(2) + "x — " + (entry.HighMulti).toFixed(2) + "x";
                }
                else if(entry.FixedMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.FixedMulti).toFixed(2);
                }
            }
            else if(secondaryInfo == "MaxMulti")    {
                if(entry.Multi != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.Multi * processGuilt(entry.Guilt)).toFixed(2);
                }
                if(entry.HighMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.LowMulti * processGuilt(entry.Guilt)).toFixed(2) + "x — " + (entry.HighMulti * processGuilt(entry.Guilt)).toFixed(2) + "x";
                }
                else if(entry.FixedMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.FixedMulti * processGuilt(entry.Guilt)).toFixed(2);
                }
            }
            else if(secondaryInfo == "MaxMultiGuiltBuff")    {
                if(entry.Multi != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.Multi * (processGuilt(entry.Guilt) + 3)).toFixed(2);
                }
                if(entry.HighMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.LowMulti * (processGuilt(entry.Guilt) + 3)).toFixed(2) + "x — " + (entry.HighMulti * (processGuilt(entry.Guilt) + 3)).toFixed(2) + "x";
                }
                else if(entry.FixedMulti != undefined)  {
                    secondaryFigCaption.innerHTML = "Multi: " + (entry.FixedMulti * (processGuilt(entry.Guilt) + 3)).toFixed(2);
                }
            }
            else if(entry[secondaryInfo] != undefined && secondaryInfo == "AlbumNum")   {
                secondaryFigCaption.innerHTML = "No. " + entry[secondaryInfo];
            }
            else if(secondaryInfo == "Hits" && entry.Ability != undefined && entry.Ability.Hits != undefined)   {
                secondaryFigCaption.innerHTML = "Hits: " + entry.Ability.Hits;
            }
            else if(entry[secondaryInfo] != undefined)   {
                secondaryFigCaption.innerHTML = secondaryInfo + ": " + entry[secondaryInfo];
            }

            var newImg = document.createElement('img');
            newImg.className = "imgClass";
            newImg.src = "./images/medals/en/" + entry.MedalImage;
            newImg.setAttribute("onclick", "generateCard(" + entry.ID + ")");

            newFig.appendChild(newImg);
            newFig.appendChild(newFigCaption);
            newFig.appendChild(secondaryFigCaption);
            newFig.style = "max-width: 50%";
            resDiv.appendChild(newFig);
    }

    maxResults = -1;
    
}

