function switchImage(value) {
    var split = value.split(",");
    var MedalID = parseInt(split[0]);
    var type = split[1];
    if(type == "Medal")    {
        if(currentDisplayedImagePath.src.indexOf("Medal") != -1) {
        }
        else{
            currentImage.src = "./images/medals/en/" + medalDatabase[MedalID].MedalImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 6);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "Off.png";
            currentImage.setAttribute("onclick", "window.open(\"./images/medals/en/" + medalDatabase[MedalID].MedalImage + "\")");
            currentDisplayedImagePath = medalButtonImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 7);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "On.png";
        }
    }
    else if(type == "Render")  {
        if(currentDisplayedImagePath.src.indexOf("Render") != -1) {

        }
        else{
            currentImage.src = "./images/renders/en/" + medalDatabase[MedalID].RenderImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 6);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "Off.png";
            currentImage.setAttribute("onclick", "window.open(\"./images/renders/en/" + medalDatabase[MedalID].RenderImage + "\")");
            currentDisplayedImagePath = renderButtonImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 7);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "On.png";
        }
    }
    else if(type == "Art") {
        if(currentDisplayedImagePath.src.indexOf("Art") != -1) {

        }
        else{
            currentImage.src = "./images/assets/artwork/" + medalDatabase[MedalID].KeyArtImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 6);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "Off.png";
            currentImage.setAttribute("onclick", "window.open(\"./images/assets/artwork/" + medalDatabase[MedalID].KeyArtImage + "\")");
            currentDisplayedImagePath = artButtonImage;
            currentDisplayedImagePath.src = currentDisplayedImagePath.src.substring(0, currentDisplayedImagePath.src.length - 7);
            currentDisplayedImagePath.src = currentDisplayedImagePath.src + "On.png";
        }
    }
    else if(type == "Music")   {
        console.log(medalDatabase[MedalID].MusicLink);
        window.open("./music/" + medalDatabase[MedalID].MusicLink);
    }
}

